import React, { useEffect, useState } from 'react';

interface Tranzactie {
  IDTranzactie: number;
  IDUtilizator: number;
  Suma: number;
  TipTranzactie: string;
  DataTranzactie: string;
}

const Tranzactii: React.FC = () => {
  const [tranzactii, setTranzactii] = useState<Tranzactie[]>([]);

  useEffect(() => {
    setTranzactii([
      { IDTranzactie: 1, IDUtilizator: 101, Suma: 200, TipTranzactie: 'Depunere', DataTranzactie: '2025-06-01T10:00:00' },
      { IDTranzactie: 2, IDUtilizator: 101, Suma: 100, TipTranzactie: 'Retragere', DataTranzactie: '2025-06-02T14:45:00' },
      { IDTranzactie: 3, IDUtilizator: 101, Suma: 300, TipTranzactie: 'Depunere', DataTranzactie: '2025-06-03T12:15:00' },
    ]);
  }, []);

  const getTransactionIcon = (tip: string) => (tip === 'Depunere' ? 'ðŸ’°' : 'ðŸ’¸');
  const getTransactionColor = (tip: string) => (tip === 'Depunere' ? 'text-green-600' : 'text-red-600');
  const getTransactionBgColor = (tip: string) => (tip === 'Depunere' ? 'bg-green-100' : 'bg-red-100');
  const getTotalBalance = () => tranzactii.reduce((total, t) => (t.TipTranzactie === 'Depunere' ? total + t.Suma : total - t.Suma), 0);

  return (
    <div
      className="min-h-screen bg-center bg-cover bg-no-repeat flex flex-col items-center pt-16 pb-16"
      style={{ backgroundImage: "url('/images/background-casino.jpg')" }}
    >
      <div className="max-w-5xl w-full bg-black bg-opacity-70 rounded-md shadow-md p-6 text-white">
        <h1 className="text-3xl font-bold mb-6 flex items-center justify-center gap-3">
          ðŸ’³ Istoric TranzacÈ›ii
        </h1>

        <div
          className={`inline-block px-6 py-3 rounded-xl border-2 mb-8 text-center ${
            getTotalBalance() >= 0 ? 'bg-green-100 border-green-600 text-green-700' : 'bg-red-100 border-red-600 text-red-700'
          }`}
        >
          <span className="uppercase text-sm font-semibold tracking-wide">Sold Total: </span>
          <span className="text-2xl font-extrabold ml-2">
            {getTotalBalance().toLocaleString('ro-RO')} RON
          </span>
        </div>

        <table className="w-full table-auto bg-white text-black rounded-md overflow-hidden">
          <thead className="bg-gradient-to-r from-indigo-600 to-indigo-700 text-white">
            <tr>
              <th className="p-4 text-left uppercase text-sm font-semibold">Tip TranzacÈ›ie</th>
              <th className="p-4 text-right uppercase text-sm font-semibold">Suma</th>
              <th className="p-4 text-center uppercase text-sm font-semibold">Data & Ora</th>
              <th className="p-4 text-center uppercase text-sm font-semibold">Status</th>
            </tr>
          </thead>
          <tbody>
            {tranzactii.map((t, index) => (
              <tr
                key={t.IDTranzactie}
                className={`transition-all hover:bg-blue-50 hover:shadow-lg ${
                  index % 2 === 0 ? '' : 'bg-gray-50'
                }`}
              >
                <td className="p-4 flex items-center gap-4">
                  <div
                    className={`w-14 h-14 rounded-lg flex items-center justify-center text-2xl border-2 ${
                      t.TipTranzactie === 'Depunere' ? 'bg-green-100 border-green-300 text-green-600' : 'bg-red-100 border-red-300 text-red-600'
                    }`}
                  >
                    {getTransactionIcon(t.TipTranzactie)}
                  </div>
                  <div>
                    <div className={`font-bold ${getTransactionColor(t.TipTranzactie)}`}>
                      {t.TipTranzactie}
                    </div>
                    <div className="text-xs text-gray-600 font-medium">
                      ID: #{t.IDTranzactie} â€¢ User: {t.IDUtilizator}
                    </div>
                  </div>
                </td>
                <td className={`p-4 text-right font-extrabold ${getTransactionColor(t.TipTranzactie)}`}>
                  {t.TipTranzactie === 'Depunere' ? '+' : '-'}
                  {t.Suma.toLocaleString('ro-RO')} RON
                  <div className="text-xs text-gray-600 uppercase font-semibold">
                    {t.TipTranzactie === 'Depunere' ? 'Credit' : 'Debit'}
                  </div>
                </td>
                <td className="p-4 text-center">
                  <div className="font-semibold text-gray-800">
                    {new Date(t.DataTranzactie).toLocaleDateString('ro-RO', {
                      day: '2-digit',
                      month: '2-digit',
                      year: 'numeric',
                    })}
                  </div>
                  <div className="text-gray-600 text-sm font-medium">
                    {new Date(t.DataTranzactie).toLocaleTimeString('ro-RO', {
                      hour: '2-digit',
                      minute: '2-digit',
                    })}
                  </div>
                </td>
                <td className="p-4 text-center">
                  <span className="inline-block px-5 py-2 rounded-full bg-green-100 text-green-700 font-bold text-xs uppercase tracking-wide border-2 border-green-300">
                    âœ“ ProcesatÄƒ
                  </span>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default Tranzactii;
